   transform="matrix(1,0,0,-1,-615.26259,118.04)"
   aria-label="UKFN Early career researchers are invited to attend a meeting  aimed at bringing together ECRs across all UKFN SIGs.  The event is intended to be an informal meeting where ECRs  can have the opportunity to present their work with a talk or a  poster, interact with each other, listen to advices for fellowships  or job applications. It concludes with a social gathering at the  pub.  There is also the possibility of subsidised travel depending on  the number of attendees.  Interested in attending this event? Please send a registration  email specifying your contribution format (poster/talk) before  the 11th of March to:  Andrew Edwards: Élfego Ruiz-Gutiérrez: Jack Panter:"><path
